import { createSlice } from "@reduxjs/toolkit";
import { getCurrentProfile } from "../thunks/profile";

const profileSlice = createSlice({
    name: 'profile',
    initialState: {
        profile: null,
        profiles: [],
        repos: [],
        loading: true,
        error: {}
    },

    extraReducers(builder) {
        builder.addCase(getCurrentProfile)
    }
})

export const profileReducer = profileSlice.reducer
